import { CHECK_USER, LOG_OUT } from "../actions/typeDefinitions";

export default function authedUser (state = {}, action) {
    switch (action.type) {
        case CHECK_USER:
            return {
                ...state,
                username: action.username
            };
        case LOG_OUT:
            return {}
        default: 
            return state;
    }
}
